var searchDocuments = {"http-server/index.html":{"link-uuid":"d3f13c81-ee10-4cb7-96a7-6bf1024799ed","title":"http-server","content":"Usage: nsd http-server [-hV] [--http-host=&lt;httpHost&gt;] [--http-port=&lt;httpPort&gt;]\r\n                       [--http-server-shutdown-timeout=&lt;timeout&gt;]\r\nServes HTTP routes\r\n  -h, --help      Show this help message and exit.\r\n      --http-host=&lt;httpHost&gt;\r\n                  HTTP host (network interface) to bind to\r\n      --http-port=&lt;httpPort&gt;\r\n                  HTTP port. If a port is not specified,\r\n                  an ephemeral port is used\r\n      --http-server-shutdown-timeout=&lt;timeout&gt;\r\n                  Timeout in seconds,\r\n                  defaults to 3 seconds\r\n  -V, --version   Print version information and exit."},"model/ecore-html-app/index.html":{"path":"model/ecore-html-app","link-uuid":"1744207f-f226-4c2c-9d97-3b75745fd42d","title":"ecore-html-app","content":"Version: org.nasdanika.models.ecore.cli@2024.12.0 \r\nUsage: nsd model ecore-html-app [-fhRV] [-P=&lt;insertionIndex&gt;] [-r=&lt;rootLabel&gt;]\r\n                                [-c=&lt;String=String&gt;]... [-C=URL]...\r\n                                [--content-type-resource-factory=&lt;String=Class&gt;]\r\n                                ...\r\n                                [--extension-resource-factory=&lt;String=Class&gt;]...\r\n                                 [-M=&lt;String=String&gt;]...\r\n                                [--protocol-resource-factory=&lt;String=Class&gt;]...\r\n                                [COMMAND]\r\nGenerates Ecore model documentation html app model\r\n  -c, --context-entry=&lt;String=String&gt;\r\n                      Context entries.\r\n                      Shadow entries in contexts and mounts.\r\n  -C, --context=URL   Context resource URL relative to the current directory.\r\n                        YAML, JSON, or properties. In properties dots are\r\n                        treated as key path separators. Type is inferred from\r\n                        the content type header, if it is present, or\r\n                        extension. Contexts are composed in the order of\r\n                        definition, later context entries shadowing the former\r\n      --content-type-resource-factory=&lt;String=Class&gt;\r\n                      Maps content type to resource factory class\r\n      --extension-resource-factory=&lt;String=Class&gt;\r\n                      Maps extension to resource factory class\r\n  -f, --file          Root action option is a file path\r\n  -h, --help          Show this help message and exit.\r\n  -M, --context-mount=&lt;String=String&gt;\r\n                      MappingContext resource URL relative to the current\r\n                        directory. YAML, JSON, or properties. In properties\r\n                        dots are treated as key path separators. Type is\r\n                        inferred from the content type header, if it is\r\n                        present, or extension. Mounts shadow context entries.\r\n  -P, --position=&lt;insertionIndex&gt;\r\n                      Insertion position\r\n                      Defaults to 0\r\n      --protocol-resource-factory=&lt;String=Class&gt;\r\n                      Maps protocol to resource factory class\r\n  -r, --root-label=&lt;rootLabel&gt;\r\n                      Root label URL or file path, resolved relative\r\n                      to the current directory\r\n  -R, --add-to-root   Add labels to the root\r\n                      even if the principal is present\r\n  -V, --version       Print version information and exit.\r\nCommands:\r\n  save  Saves model to a file\r\n  site  Generates HTML site"},"model/html-app/site/index.html":{"path":"model/html-app/site","link-uuid":"0c58fbca-e68c-4d78-ad86-990f195a64a9","title":"site","content":"Version: org.nasdanika.models.app.cli@2024.12.0 \r\nUsage: nsd model html-app site [-hlV] [--progress-console] [--progress-data]\r\n                               [--progress-json] [-b=&lt;baseDir&gt;]\r\n                               [-F=&lt;pageTemplateFile&gt;] [-m=&lt;domian&gt;]\r\n                               [-P=&lt;parallelism&gt;]\r\n                               [--progress-output=&lt;progressOutput&gt;]\r\n                               [-r=&lt;pageErrors&gt;] [-t=&lt;timeout&gt;]\r\n                               [-T=&lt;pageTemplate&gt;] [-w=&lt;workDir&gt;]\r\n                               [-c=&lt;String=String&gt;]... [-C=URL]...\r\n                               [-M=&lt;String=String&gt;]... [-e[=&lt;excludes&gt;...]]...\r\n                               [-i[=&lt;includes&gt;...]]... &lt;output&gt;\r\nGenerates HTML site\r\n      &lt;output&gt;               Output directory relative to the base directory\r\n  -b, --base-dir=&lt;baseDir&gt;   Base directory\r\n  -c, --context-entry=&lt;String=String&gt;\r\n                             Context entries.\r\n                             Shadow entries in contexts and mounts.\r\n  -C, --context=URL          Context resource URL relative to the current\r\n                               directory. YAML, JSON, or properties. In\r\n                               properties dots are treated as key path\r\n                               separators. Type is inferred from the content\r\n                               type header, if it is present, or extension.\r\n                               Contexts are composed in the order of\r\n                               definition, later context entries shadowing the\r\n                               former\r\n  -e, --exclude[=&lt;excludes&gt;...]\r\n                             Output directory clean excludes\r\n                             Ant pattern\r\n  -F, --page-template-file=&lt;pageTemplateFile&gt;\r\n                             Page template file relative\r\n                             to the current directory\r\n  -h, --help                 Show this help message and exit.\r\n  -i, --include[=&lt;includes&gt;...]\r\n                             Output directory clean includes\r\n                             Ant pattern\r\n  -l, --[no-]clean           Clean working directory\r\n                             defaults to true\r\n  -m, --domain=&lt;domian&gt;      Sitemap domain\r\n  -M, --context-mount=&lt;String=String&gt;\r\n                             MappingContext resource URL relative to the\r\n                               current directory. YAML, JSON, or properties. In\r\n                               properties dots are treated as key path\r\n                               separators. Type is inferred from the content\r\n                               type header, if it is present, or extension.\r\n                               Mounts shadow context entries.\r\n  -P, --parallelism=&lt;parallelism&gt;\r\n                             If the value greater than one then an executor\r\n                               service is created and injected into the context\r\n                               to allow concurrent execution.\r\n      --progress-console     Output progress to console\r\n      --progress-data        Output progress data\r\n      --progress-json        Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                             Output file for progress monitor\r\n  -r, --errors=&lt;pageErrors&gt;  Expected number of page errors\r\n                             -1 for any (not fail on errors)\r\n                             default is 0\r\n  -t, --timeout=&lt;timeout&gt;    If parallelism is greater than one this option\r\n                               specifies timout in seconds awaiting completion\r\n                               of execution. Default value is 60.\r\n  -T, --page-template=&lt;pageTemplate&gt;\r\n                             Page template URI relative\r\n                             to the current directory\r\n  -V, --version              Print version information and exit.\r\n  -w, --work-dir=&lt;workDir&gt;   Working directory\r\nExit codes:\r\n  Non-negative number   Delegate result\r\n  -1                    Unhandled exception during execution\r\n  -2                    Invalid input\r\n  -3                    Diagnostic failed\r\n  -4                    Execution failed or was cancelled, successful rollback\r\n  -5                    Execution failed or was cancelled, rollback failed\r\n  -6                    Executor service termination timed out"},"gitlab/contribute/retrospect/gsh/index.html":{"path":"gitlab/contribute/retrospect/gsh","link-uuid":"0fa074f9-3e9e-4d7c-9f2f-34700a771c1a","title":"gsh","content":"Version: org.nasdanika.groovy@2024.12.0 \r\nUsage: nsd gitlab contribute retrospect gsh [-hV] [--progress-console]\r\n       [--progress-data] [--progress-json] [--progress-output=&lt;progressOutput&gt;]\r\n       [-p=&lt;String=String&gt;]... [-P=URL]... [&lt;args&gt;...]\r\nGroovy Shell\r\n      [&lt;args&gt;...]          Argument URIs\r\n  -h, --help               Show this help message and exit.\r\n  -p, --property=&lt;String=String&gt;\r\n                           Property\r\n  -P, --properties=URL     Properties resource URL relative to the current\r\n                             directory. YAML, JSON, or properties. Type is\r\n                             inferred from the content type header, if it is\r\n                             present, or extension. Properties are loaded in\r\n                             the order of definition, later properties\r\n                             replacing the former\r\n      --progress-console   Output progress to console\r\n      --progress-data      Output progress data\r\n      --progress-json      Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                           Output file for progress monitor\r\n  -V, --version            Print version information and exit."},"list-inspectable-rules/index.html":{"link-uuid":"731852f5-e2f9-4747-9112-d69fbc0ab747","title":"list-inspectable-rules","content":"Version: org.nasdanika.launcher.demo \r\nUsage: nsd list-inspectable-rules [-hV] [--progress-console] [--progress-data]\r\n                                  [--progress-json] [-o=&lt;output&gt;]\r\n                                  [--progress-output=&lt;progressOutput&gt;]\r\n                                  [--exclude-rule[=&lt;ruleExcludes&gt;...]]...\r\n                                  [--exclude-rule-set\r\n                                  [=&lt;ruleSetExcludes&gt;...]]... [--include-rule\r\n                                  [=&lt;ruleIncludes&gt;...]]... [--include-rule-set\r\n                                  [=&lt;ruleSetIncludes&gt;...]]...\r\nLists available rules\r\n      --exclude-rule[=&lt;ruleExcludes&gt;...]\r\n                           ID's of rules to exclude\r\n      --exclude-rule-set[=&lt;ruleSetExcludes&gt;...]\r\n                           ID's of rule sets to exclude\r\n  -h, --help               Show this help message and exit.\r\n      --include-rule[=&lt;ruleIncludes&gt;...]\r\n                           ID's of rules to include\r\n      --include-rule-set[=&lt;ruleSetIncludes&gt;...]\r\n                           ID's of rule sets to include\r\n  -o, --output=&lt;output&gt;    Output file\r\n      --progress-console   Output progress to console\r\n      --progress-data      Output progress data\r\n      --progress-json      Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                           Output file for progress monitor\r\n  -V, --version            Print version information and exit."},"model/ecore-html-app/site/index.html":{"path":"model/ecore-html-app/site","link-uuid":"428925d3-fbd7-49ab-b656-94fe63d4b500","title":"site","content":"Version: org.nasdanika.models.app.cli@2024.12.0 \r\nUsage: nsd model ecore-html-app site [-hlV] [--progress-console]\r\n                                     [--progress-data] [--progress-json]\r\n                                     [-b=&lt;baseDir&gt;] [-F=&lt;pageTemplateFile&gt;]\r\n                                     [-m=&lt;domian&gt;] [-P=&lt;parallelism&gt;]\r\n                                     [--progress-output=&lt;progressOutput&gt;]\r\n                                     [-r=&lt;pageErrors&gt;] [-t=&lt;timeout&gt;]\r\n                                     [-T=&lt;pageTemplate&gt;] [-w=&lt;workDir&gt;]\r\n                                     [-c=&lt;String=String&gt;]... [-C=URL]...\r\n                                     [-M=&lt;String=String&gt;]... [-e\r\n                                     [=&lt;excludes&gt;...]]... [-i\r\n                                     [=&lt;includes&gt;...]]... &lt;output&gt;\r\nGenerates HTML site\r\n      &lt;output&gt;               Output directory relative to the base directory\r\n  -b, --base-dir=&lt;baseDir&gt;   Base directory\r\n  -c, --context-entry=&lt;String=String&gt;\r\n                             Context entries.\r\n                             Shadow entries in contexts and mounts.\r\n  -C, --context=URL          Context resource URL relative to the current\r\n                               directory. YAML, JSON, or properties. In\r\n                               properties dots are treated as key path\r\n                               separators. Type is inferred from the content\r\n                               type header, if it is present, or extension.\r\n                               Contexts are composed in the order of\r\n                               definition, later context entries shadowing the\r\n                               former\r\n  -e, --exclude[=&lt;excludes&gt;...]\r\n                             Output directory clean excludes\r\n                             Ant pattern\r\n  -F, --page-template-file=&lt;pageTemplateFile&gt;\r\n                             Page template file relative\r\n                             to the current directory\r\n  -h, --help                 Show this help message and exit.\r\n  -i, --include[=&lt;includes&gt;...]\r\n                             Output directory clean includes\r\n                             Ant pattern\r\n  -l, --[no-]clean           Clean working directory\r\n                             defaults to true\r\n  -m, --domain=&lt;domian&gt;      Sitemap domain\r\n  -M, --context-mount=&lt;String=String&gt;\r\n                             MappingContext resource URL relative to the\r\n                               current directory. YAML, JSON, or properties. In\r\n                               properties dots are treated as key path\r\n                               separators. Type is inferred from the content\r\n                               type header, if it is present, or extension.\r\n                               Mounts shadow context entries.\r\n  -P, --parallelism=&lt;parallelism&gt;\r\n                             If the value greater than one then an executor\r\n                               service is created and injected into the context\r\n                               to allow concurrent execution.\r\n      --progress-console     Output progress to console\r\n      --progress-data        Output progress data\r\n      --progress-json        Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                             Output file for progress monitor\r\n  -r, --errors=&lt;pageErrors&gt;  Expected number of page errors\r\n                             -1 for any (not fail on errors)\r\n                             default is 0\r\n  -t, --timeout=&lt;timeout&gt;    If parallelism is greater than one this option\r\n                               specifies timout in seconds awaiting completion\r\n                               of execution. Default value is 60.\r\n  -T, --page-template=&lt;pageTemplate&gt;\r\n                             Page template URI relative\r\n                             to the current directory\r\n  -V, --version              Print version information and exit.\r\n  -w, --work-dir=&lt;workDir&gt;   Working directory\r\nExit codes:\r\n  Non-negative number   Delegate result\r\n  -1                    Unhandled exception during execution\r\n  -2                    Invalid input\r\n  -3                    Diagnostic failed\r\n  -4                    Execution failed or was cancelled, successful rollback\r\n  -5                    Execution failed or was cancelled, rollback failed\r\n  -6                    Executor service termination timed out"},"gitlab/index.html":{"link-uuid":"ccf2939e-2cda-4cd0-a9d3-7bdb30c9d325","title":"gitlab","content":"Usage: nsd gitlab [-hV] [-l=&lt;clientRateLimit&gt;] [-t=&lt;accessToken&gt;] [-u=&lt;url&gt;]\r\n                  [-w=&lt;clientRateLimitWindow&gt;] [COMMAND]\r\nCommands for working with GitLab\r\n  -h, --help        Show this help message and exit.\r\n  -l, --client-rate-limit=&lt;clientRateLimit&gt;\r\n                    Client enforced rate limit\r\n                    use this option if the server limits requests rate,\r\n                    but does not rate limit headers to the client\r\n                    only errors if the rate limit is exceeded\r\n  -t, --access-token=&lt;accessToken&gt;\r\n                    GitLab access token, defaults to the value of\r\n                    GITLAB_ACCESS_TOKEN environment variable\r\n  -u, --url=&lt;url&gt;   GitLab URL, defaults to the value of\r\n                    GITLAB_URL environment variable\r\n  -V, --version     Print version information and exit.\r\n  -w, --client-rate-limit-window=&lt;clientRateLimitWindow&gt;\r\n                    Client enforced rate limit window in seconds\r\n                    defaults to 10\r\n                    ignored if the client rate limit is not set\r\nCommands:\r\n  contribute  Parent for sub-command contributing via GitLabURIHandler\r\n  gsh         Groovy Shell\r\n  invoke      Invokes URI"},"rules/index.html":{"link-uuid":"a95f513f-1743-406d-bc3d-e51db894684f","title":"rules","content":"Usage: nsd rules [-hV] [COMMAND]\r\nRules commands\r\n  -h, --help      Show this help message and exit.\r\n  -V, --version   Print version information and exit.\r\nCommands:\r\n  action-model  Generates rule set documentation action model\r\n  list          Lists available rule sets and rules\r\n  site          Generates rule set documentation site"},"exit/index.html":{"link-uuid":"6b1cb0fb-908a-454a-a923-16adc3e474ba","title":"exit","content":"Version: org.nasdanika.cli@2024.12.0 \r\nUsage: nsd exit [-hV]\r\nExits shell\r\n  -h, --help      Show this help message and exit.\r\n  -V, --version   Print version information and exit."},"gitlab/contribute/retrospect/demo/index.html":{"path":"gitlab/contribute/retrospect/demo","link-uuid":"e139425d-d906-4599-94de-9426bb8472f6","title":"demo","content":"Usage: nsd gitlab contribute retrospect demo [-hV]\r\nDemo retrospect command\r\n  -h, --help      Show this help message and exit.\r\n  -V, --version   Print version information and exit."},"rules/list/index.html":{"path":"rules/list","link-uuid":"c5333c3a-3415-4631-85a2-1d41ef4325d2","title":"list","content":"Usage: nsd rules list [-hrV] [--progress-console] [--progress-data]\r\n                      [--progress-json] [-o=&lt;output&gt;]\r\n                      [--progress-output=&lt;progressOutput&gt;] [--exclude-rule\r\n                      [=&lt;ruleExcludes&gt;...]]... [--exclude-rule-set\r\n                      [=&lt;ruleSetExcludes&gt;...]]... [--include-rule\r\n                      [=&lt;ruleIncludes&gt;...]]... [--include-rule-set\r\n                      [=&lt;ruleSetIncludes&gt;...]]...\r\nLists available rule sets and rules\r\n      --exclude-rule[=&lt;ruleExcludes&gt;...]\r\n                           ID's of rules to exclude\r\n      --exclude-rule-set[=&lt;ruleSetExcludes&gt;...]\r\n                           ID's of rule sets to exclude\r\n  -h, --help               Show this help message and exit.\r\n      --include-rule[=&lt;ruleIncludes&gt;...]\r\n                           ID's of rules to include\r\n      --include-rule-set[=&lt;ruleSetIncludes&gt;...]\r\n                           ID's of rule sets to include\r\n  -o, --output=&lt;output&gt;    Output file\r\n      --progress-console   Output progress to console\r\n      --progress-data      Output progress data\r\n      --progress-json      Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                           Output file for progress monitor\r\n  -r, --[no-]rules         Output rules\r\n  -V, --version            Print version information and exit."},"model/save/index.html":{"path":"model/save","link-uuid":"0e99faf6-c793-401b-ae31-99c66503b784","title":"save","content":"Version: org.nasdanika.cli@2024.12.0 \r\nUsage: nsd model save [-hV] [--progress-console] [--progress-data]\r\n                      [--progress-json] [--progress-output=&lt;progressOutput&gt;]\r\n                      [--content-type-resource-factory=&lt;String=Class&gt;]...\r\n                      [--extension-resource-factory=&lt;String=Class&gt;]...\r\n                      [--protocol-resource-factory=&lt;String=Class&gt;]... &lt;output&gt;\r\nSaves model to a file\r\n      &lt;output&gt;             Output file\r\n      --content-type-resource-factory=&lt;String=Class&gt;\r\n                           Maps content type to resource factory class\r\n      --extension-resource-factory=&lt;String=Class&gt;\r\n                           Maps extension to resource factory class\r\n  -h, --help               Show this help message and exit.\r\n      --progress-console   Output progress to console\r\n      --progress-data      Output progress data\r\n      --progress-json      Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                           Output file for progress monitor\r\n      --protocol-resource-factory=&lt;String=Class&gt;\r\n                           Maps protocol to resource factory class\r\n  -V, --version            Print version information and exit."},"gitlab/contribute/retrospect/demo-analyze/index.html":{"path":"gitlab/contribute/retrospect/demo-analyze","link-uuid":"1d118ad6-9fd3-4253-b5a4-b1be797d00cb","title":"demo-analyze","content":"Usage: nsd gitlab contribute retrospect demo-analyze [-hV] [--progress-console]\r\n       [--progress-data] [--progress-json] [-p=&lt;pom&gt;]\r\n       [--progress-output=&lt;progressOutput&gt;]\r\nDemo source analysis command\r\n  -h, --help               Show this help message and exit.\r\n  -p, --pom=&lt;pom&gt;          Pom file, defaults to pom.xml\r\n      --progress-console   Output progress to console\r\n      --progress-data      Output progress data\r\n      --progress-json      Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                           Output file for progress monitor\r\n  -V, --version            Print version information and exit."},"launcher/index.html":{"link-uuid":"ccda2039-f266-46fb-9d38-87391b99a439","title":"launcher","content":"Version: org.nasdanika.cli@2024.12.0 \r\nUsage: nsd launcher [-hstvV] [-a=&lt;args&gt;] [-b=&lt;base&gt;] [-c=&lt;className&gt;]\r\n                    [-C=&lt;classPathModules&gt;] [-f=&lt;optionsFile&gt;]\r\n                    [-j=&lt;javaCommand&gt;] [-m=&lt;moduleName&gt;] [-M=&lt;modulesFile&gt;]\r\n                    [-o=&lt;output&gt;] [-p=&lt;pathSeparator&gt;] [-P=&lt;prefix&gt;]\r\n                    [-r=&lt;rootModules&gt;] [&lt;repositories&gt;...]\r\nGenerates Java command line from directories of modules/jars\r\n      [&lt;repositories&gt;...]    Directories to scan for modules,\r\n                             defaults to lib\r\n  -a, --args=&lt;args&gt;          Arguments,\r\n                             defaults to %*\r\n  -b, --base=&lt;base&gt;          Base repositories directory\r\n  -c, --class=&lt;className&gt;    Application class,\r\n                             defaults to org.nasdanika.cli.Application\r\n  -C, --claspath-modules=&lt;classPathModules&gt;\r\n                             Comma-separated list of classpath modules\r\n  -f, --options-file=&lt;optionsFile&gt;\r\n                             File to output options to\r\n  -h, --help                 Show this help message and exit.\r\n  -j, --java=&lt;javaCommand&gt;   Java command,\r\n                             defaults to java\r\n  -m, --module=&lt;moduleName&gt;  Application module,\r\n                             defaults to org.nasdanika.cli\r\n  -M, --modules=&lt;modulesFile&gt;\r\n                             Modules to add to the module path\r\n  -o, --output=&lt;output&gt;      Output file\r\n  -p, --path-separator=&lt;pathSeparator&gt;\r\n                             Path separator,\r\n                             defaults to the system path separator\r\n  -P, --prefix=&lt;prefix&gt;      Module path prefix\r\n  -r, --root-modules=&lt;rootModules&gt;\r\n                             Comma-separated list of root modules\r\n                             Supports .* and .** patterns\r\n  -s, --absolute             Use absolute paths\r\n  -t, --options              Output only options\r\n  -v, --verbose              Output debug information\r\n  -V, --version              Print version information and exit."},"drawio/index.html":{"link-uuid":"2ee2a77b-6481-4b2d-980f-1398e0b8fff2","title":"drawio","content":"Version: org.nasdanika.cli@2024.12.0 \r\nUsage: nsd drawio [-fhV] [-p=&lt;String=String&gt;]... [-P=URL]...\r\n                  [-u=&lt;String=String&gt;]... [-U=URL of URI to URL mapping\r\n                  resource]... &lt;document&gt; [COMMAND]\r\nLoads Drawio document from a URI or file\r\n      &lt;document&gt;         Document URI or file path, resolved relative\r\n                         to the current directory\r\n  -f, --file             Document parameter is a file path\r\n  -h, --help             Show this help message and exit.\r\n  -p, --property=&lt;String=String&gt;\r\n                         Property\r\n  -P, --properties=URL   Properties resource URL relative to the current\r\n                           directory. YAML, JSON, or properties. Type is\r\n                           inferred from the content type header, if it is\r\n                           present, or extension. Properties are loaded in the\r\n                           order of definition, later properties replacing the\r\n                           former\r\n  -u, --uri=&lt;String=String&gt;\r\n                         URI to URL mapping\r\n                         Target URLs are resolved\r\n                         relative to the document URL\r\n  -U, --uris=URL of URI to URL mapping resource\r\n                         URI map resource URL relative to the document file\r\n                         YAML, JSON, or properties\r\n                         Type is inferred from the content type header, if it\r\n                           is present,\r\n                         or extension\r\n  -V, --version          Print version information and exit.\r\nCommands:\r\n  html-app  Generates html application model from a drawio document"},"gitlab/invoke/index.html":{"path":"gitlab/invoke","link-uuid":"5607f55c-bc25-428f-9285-a67f30347ff0","title":"invoke","content":"Version: org.nasdanika.cli@2024.12.0 \r\nUsage: nsd gitlab invoke [-fhV] [--progress-console] [--progress-data]\r\n                         [--progress-json] [--progress-output=&lt;progressOutput&gt;]\r\n                         [-p=&lt;String=String&gt;]... [-P=URL]... &lt;uri&gt;\r\n                         [&lt;bindings&gt;...]\r\nInvokes URI\r\n      &lt;uri&gt;                URI to invoke\r\n      [&lt;bindings&gt;...]      Bindings URIs\r\n  -f, --file               URI parameter is a file path\r\n  -h, --help               Show this help message and exit.\r\n  -p, --property=&lt;String=String&gt;\r\n                           Property\r\n  -P, --properties=URL     Properties resource URL relative to the current\r\n                             directory. YAML, JSON, or properties. Type is\r\n                             inferred from the content type header, if it is\r\n                             present, or extension. Properties are loaded in\r\n                             the order of definition, later properties\r\n                             replacing the former\r\n      --progress-console   Output progress to console\r\n      --progress-data      Output progress data\r\n      --progress-json      Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                           Output file for progress monitor\r\n  -V, --version            Print version information and exit."},"rules/site/index.html":{"path":"rules/site","link-uuid":"1e439270-8236-451e-9cef-87dc01269835","title":"site","content":"Usage: nsd rules site [-fhlRV] [--progress-console] [--progress-data]\r\n                      [--progress-json] [-b=&lt;baseDir&gt;] [-m=&lt;domian&gt;]\r\n                      [-P=&lt;parallelism&gt;] [--progress-output=&lt;progressOutput&gt;]\r\n                      [-r=&lt;pageErrors&gt;] [--root-action-icon=&lt;rootActionIcon&gt;]\r\n                      [--root-action-location=&lt;rootActionLocation&gt;]\r\n                      [--root-action-text=&lt;rootActionText&gt;] [-t=&lt;timeout&gt;]\r\n                      [-T=&lt;pageTemplate&gt;] [-w=&lt;workDir&gt;]\r\n                      [-c=&lt;String=String&gt;]... [-C=URL]...\r\n                      [-M=&lt;String=String&gt;]... [-e[=&lt;excludes&gt;...]]... [-i\r\n                      [=&lt;includes&gt;...]]... &lt;model&gt; &lt;output&gt;\r\nGenerates rule set documentation site\r\n      &lt;model&gt;                Model URI, resolved relative\r\n                             to the current directory\r\n                             or looked up in registered rule sets\r\n                             if -R option is provided\r\n      &lt;output&gt;               Output directory\r\n  -b, --base-dir=&lt;baseDir&gt;   Base directory\r\n  -c, --context-entry=&lt;String=String&gt;\r\n                             Context entries.\r\n                             Shadow entries in contexts and mounts.\r\n  -C, --context=URL          Context resource URL relative to the current\r\n                               directory. YAML, JSON, or properties. In\r\n                               properties dots are treated as key path\r\n                               separators. Type is inferred from the content\r\n                               type header, if it is present, or extension.\r\n                               Contexts are composed in the order of\r\n                               definition, later context entries shadowing the\r\n                               former\r\n  -e, --exclude[=&lt;excludes&gt;...]\r\n                             Output directory clean excludes\r\n                             Ant pattern\r\n  -f, --file                 Mdel parameter is a file path\r\n  -h, --help                 Show this help message and exit.\r\n  -i, --include[=&lt;includes&gt;...]\r\n                             Output directory clean includes\r\n                             Ant pattern\r\n  -l, --[no-]clean           Clean working directory\r\n                             defaults to true\r\n  -m, --domain=&lt;domian&gt;      Sitemap domain\r\n  -M, --context-mount=&lt;String=String&gt;\r\n                             MappingContext resource URL relative to the\r\n                               current directory. YAML, JSON, or properties. In\r\n                               properties dots are treated as key path\r\n                               separators. Type is inferred from the content\r\n                               type header, if it is present, or extension.\r\n                               Mounts shadow context entries.\r\n  -P, --parallelism=&lt;parallelism&gt;\r\n                             If the value greater than one then an executor\r\n                               service is created and injected into the context\r\n                               to allow concurrent execution.\r\n      --progress-console     Output progress to console\r\n      --progress-data        Output progress data\r\n      --progress-json        Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                             Output file for progress monitor\r\n  -r, --errors=&lt;pageErrors&gt;  Expected number of page errors\r\n                             -1 for any (not fail on errors)\r\n                             default is 0\r\n  -R, --registered           Use registered rule set\r\n                             with provided URI\r\n      --root-action-icon=&lt;rootActionIcon&gt;\r\n                             Root action icon\r\n      --root-action-location=&lt;rootActionLocation&gt;\r\n                             Root action location\r\n      --root-action-text=&lt;rootActionText&gt;\r\n                             Root action text\r\n  -t, --timeout=&lt;timeout&gt;    If parallelism is greater than one this option\r\n                               specifies timout in seconds awaiting completion\r\n                               of execution. Default value is 60.\r\n  -T, --page-template=&lt;pageTemplate&gt;\r\n                             Page template URI relative\r\n                             to the current directory\r\n  -V, --version              Print version information and exit.\r\n  -w, --work-dir=&lt;workDir&gt;   Working directory\r\nExit codes:\r\n  Non-negative number   Delegate result\r\n  -1                    Unhandled exception during execution\r\n  -2                    Invalid input\r\n  -3                    Diagnostic failed\r\n  -4                    Execution failed or was cancelled, successful rollback\r\n  -5                    Execution failed or was cancelled, rollback failed\r\n  -6                    Executor service termination timed out"},"model/html-app/save/index.html":{"path":"model/html-app/save","link-uuid":"7232c0c5-f990-44dc-84eb-e940af641b26","title":"save","content":"Version: org.nasdanika.cli@2024.12.0 \r\nUsage: nsd model html-app save [-hV] [--progress-console] [--progress-data]\r\n                               [--progress-json]\r\n                               [--progress-output=&lt;progressOutput&gt;]\r\n                               [--content-type-resource-factory=&lt;String=Class&gt;].\r\n                               ..\r\n                               [--extension-resource-factory=&lt;String=Class&gt;]...\r\n                               [--protocol-resource-factory=&lt;String=Class&gt;]...\r\n                               &lt;output&gt;\r\nSaves model to a file\r\n      &lt;output&gt;             Output file\r\n      --content-type-resource-factory=&lt;String=Class&gt;\r\n                           Maps content type to resource factory class\r\n      --extension-resource-factory=&lt;String=Class&gt;\r\n                           Maps extension to resource factory class\r\n  -h, --help               Show this help message and exit.\r\n      --progress-console   Output progress to console\r\n      --progress-data      Output progress data\r\n      --progress-json      Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                           Output file for progress monitor\r\n      --protocol-resource-factory=&lt;String=Class&gt;\r\n                           Maps protocol to resource factory class\r\n  -V, --version            Print version information and exit."},"gitlab/contribute/junit/jacoco/index.html":{"path":"gitlab/contribute/junit/jacoco","link-uuid":"976f6f11-046f-4619-97c1-0049a4266c86","title":"jacoco","content":"Usage: nsd gitlab contribute junit jacoco [-hV] [-c=&lt;classes&gt;] [-j=&lt;jacoco&gt;]\r\n       [-m=&lt;moduleName&gt;]\r\nLoads coverage from jacoco.exec and classes directory\r\n  -c, --classes=&lt;classes&gt;   Classes directory path relative\r\n                            to the project directory,\r\n                            defaults to target/classes\r\n  -h, --help                Show this help message and exit.\r\n  -j, --jacoco=&lt;jacoco&gt;     jacoco.exec file path relative\r\n                            to the project directory,\r\n                            defaults to target/jacoco.exec\r\n  -m, --module=&lt;moduleName&gt; Coverage module name\r\n  -V, --version             Print version information and exit."},"app/index.html":{"link-uuid":"37ed652f-3b3b-44f0-bf51-c3dd10e30cd1","title":"app","content":"Version: org.nasdanika.models.app.cli@2024.12.0 \r\nUsage: nsd app [-hV] [COMMAND]\r\nHTML Application model commands\r\n  -h, --help      Show this help message and exit.\r\n  -V, --version   Print version information and exit.\r\nCommands:\r\n  site  Generates HTML site"},"index.html":{"link-uuid":"34865b90-6e07-4d15-8c9d-06dc9b86e828","title":"nsd","content":"Version: org.nasdanika.cli@2024.12.0 \r\nUsage: nsd [-hV] COMMAND\r\nNasdanika Command Line Interface\r\n  -h, --help      Show this help message and exit.\r\n  -V, --version   Print version information and exit.\r\nCommands:\r\n  launcher                Generates Java command line from directories of\r\n                            modules/jars\r\n  app                     HTML Application model commands\r\n  drawio                  Loads Drawio document from a URI or file\r\n  gitlab                  Commands for working with GitLab\r\n  gsh                     Groovy Shell\r\n  help                    Outputs usage for all registred commands\r\n  http-server             Serves HTTP routes\r\n  inspect-yaml            Demo of YAML inspection\r\n  invoke                  Invokes URI\r\n  java                    Commands related to Java\r\n  list-inspectable-rules  Lists available rules\r\n  list-rules              Lists available rules\r\n  model                   Loads EObject from a URI or file\r\n  module-graph            Generates module dependency graph\r\n  rules                   Rules commands\r\n  shell                   Starts an interactive shell\r\n  exit                    Exits shell"},"gitlab/contribute/index.html":{"path":"gitlab/contribute","link-uuid":"840170d2-791d-4879-b411-d502839ed311","title":"contribute","content":"Usage: nsd gitlab contribute [-hV] [-a=&lt;String=String&gt;]... (&lt;authorEmail&gt;\r\n                             &lt;authorName&gt; [-m=&lt;commitMessage&gt;] [-b=&lt;branch&gt;]\r\n                             [-f] [-s]) [[-t=&lt;targetBranch&gt;] [--[no-]\r\n                             allow-collaboration]\r\n                             [--approvals-before-merge=&lt;approvalsBeforeMerge&gt;]\r\n                             [--assignee=&lt;Assignee ID&gt;]...\r\n                             [--merge-request-description=&lt;description&gt;] [--\r\n                             [no-]discussion-locked] [--label=&lt;labels&gt;]...\r\n                             [--milestone=&lt;milestoneId&gt;] [--[no-]\r\n                             remove-source-branch] [--reviewer=&lt;Reviewer\r\n                             ID&gt;]... [--[no-]squash]\r\n                             [--merge-request-title=&lt;title&gt;]\r\n                             [--state-event=&lt;stateEvent&gt;]] [COMMAND]\r\nParent for sub-command contributing via GitLabURIHandler\r\n  -a, --alias=&lt;String=String&gt;\r\n                          Map project alias (key) to project ID or path (value)\r\n  -h, --help              Show this help message and exit.\r\n  -V, --version           Print version information and exit.\r\nCommit\r\n      &lt;authorEmail&gt;       Commit author eMail\r\n      &lt;authorName&gt;        Commit author name\r\n  -b, --branch=&lt;branch&gt;   Branch to commit to\r\n  -f, --force             Force commit\r\n  -m, --commit-message=&lt;commitMessage&gt;\r\n                          Commit message\r\n  -s, --stats             With stats\r\nMerge request\r\n      --[no-]allow-collaboration\r\n\r\n      --approvals-before-merge=&lt;approvalsBeforeMerge&gt;\r\n                          Number of approvals before merge\r\n      --assignee=&lt;Assignee ID&gt;\r\n                          Assignee ID\r\n      --[no-]discussion-locked\r\n\r\n      --label=&lt;labels&gt;\r\n      --merge-request-description=&lt;description&gt;\r\n\r\n      --merge-request-title=&lt;title&gt;\r\n\r\n      --milestone=&lt;milestoneId&gt;\r\n                          Milestone ID\r\n      --[no-]remove-source-branch\r\n\r\n      --reviewer=&lt;Reviewer ID&gt;\r\n                          Reviewer ID\r\n      --[no-]squash\r\n      --state-event=&lt;stateEvent&gt;\r\n                          Valid values: close, reopen\r\n  -t, --target-branch=&lt;targetBranch&gt;\r\n                          Target branch, defaults to the original branch\r\nCommands:\r\n  gsh         Groovy Shell\r\n  invoke      Invokes URI\r\n  junit       Generates JUnit tests\r\n  retrospect  Parent for sub-commands contributing based on history"},"java/junit/jacoco/index.html":{"path":"java/junit/jacoco","link-uuid":"c971ae49-5b3a-4600-83a6-7397a75824a4","title":"jacoco","content":"Usage: nsd java junit jacoco [-hV] [-c=&lt;classes&gt;] [-j=&lt;jacoco&gt;]\r\n                             [-m=&lt;moduleName&gt;]\r\nLoads coverage from jacoco.exec and classes directory\r\n  -c, --classes=&lt;classes&gt;   Classes directory path relative\r\n                            to the project directory,\r\n                            defaults to target/classes\r\n  -h, --help                Show this help message and exit.\r\n  -j, --jacoco=&lt;jacoco&gt;     jacoco.exec file path relative\r\n                            to the project directory,\r\n                            defaults to target/jacoco.exec\r\n  -m, --module=&lt;moduleName&gt; Coverage module name\r\n  -V, --version             Print version information and exit."},"gitlab/contribute/retrospect/index.html":{"path":"gitlab/contribute/retrospect","link-uuid":"10c22242-9062-4964-baba-7dafb7f7efca","title":"retrospect","content":"Usage: nsd gitlab contribute retrospect [-hV] [--ref=&lt;ref&gt;] [--since=&lt;since&gt;]\r\n                                        [--until=&lt;until&gt;] [--path=&lt;paths&gt;]...\r\n                                        &lt;project&gt; [COMMAND]\r\nParent for sub-commands contributing based on history\r\n      &lt;project&gt;         Project ID or path\r\n  -h, --help            Show this help message and exit.\r\n      --path=&lt;paths&gt;    Paths of interest\r\n      --ref=&lt;ref&gt;       Reference - branch, tag, or commit\r\n      --since=&lt;since&gt;   Since date in ISO8601 format yyyy-MM-dd'T'HH:mm:ssZ\r\n      --until=&lt;until&gt;   Since date in ISO8601 format yyyy-MM-dd'T'HH:mm:ssZ\r\n  -V, --version         Print version information and exit.\r\nCommands:\r\n  demo          Demo retrospect command\r\n  demo-analyze  Demo source analysis command\r\n  gsh           Groovy Shell\r\n  invoke        Invokes URI"},"drawio/html-app/index.html":{"path":"drawio/html-app","link-uuid":"86cb9988-84ba-4a1b-ac3e-a496b5f22eb0","title":"html-app","content":"Version: org.nasdanika.models.app.cli@2024.12.0 \r\nUsage: nsd drawio html-app [-fhRV] [-b=&lt;base&gt;] [-P=&lt;insertionIndex&gt;]\r\n                           [-r=&lt;rootLabel&gt;]\r\n                           [--content-type-resource-factory=&lt;String=Class&gt;]...\r\n                           [--extension-resource-factory=&lt;String=Class&gt;]...\r\n                           [--protocol-resource-factory=&lt;String=Class&gt;]...\r\n                           [COMMAND]\r\nGenerates html application model from a drawio document\r\n  -b, --base-uri=&lt;base&gt;   Base URI. E.g. 'pages/'\r\n      --content-type-resource-factory=&lt;String=Class&gt;\r\n                          Maps content type to resource factory class\r\n      --extension-resource-factory=&lt;String=Class&gt;\r\n                          Maps extension to resource factory class\r\n  -f, --file              Root action option is a file path\r\n  -h, --help              Show this help message and exit.\r\n  -P, --position=&lt;insertionIndex&gt;\r\n                          Insertion position\r\n                          Defaults to 0\r\n      --protocol-resource-factory=&lt;String=Class&gt;\r\n                          Maps protocol to resource factory class\r\n  -r, --root-label=&lt;rootLabel&gt;\r\n                          Root label URL or file path, resolved relative\r\n                          to the current directory\r\n  -R, --add-to-root       Add labels to the root\r\n                          even if the principal is present\r\n  -V, --version           Print version information and exit.\r\nCommands:\r\n  save  Saves model to a file\r\n  site  Generates HTML site"},"drawio/html-app/site/index.html":{"path":"drawio/html-app/site","link-uuid":"5355c454-5e18-4862-8f2f-2359dda89f0a","title":"site","content":"Version: org.nasdanika.models.app.cli@2024.12.0 \r\nUsage: nsd drawio html-app site [-hlV] [--progress-console] [--progress-data]\r\n                                [--progress-json] [-b=&lt;baseDir&gt;]\r\n                                [-F=&lt;pageTemplateFile&gt;] [-m=&lt;domian&gt;]\r\n                                [-P=&lt;parallelism&gt;]\r\n                                [--progress-output=&lt;progressOutput&gt;]\r\n                                [-r=&lt;pageErrors&gt;] [-t=&lt;timeout&gt;]\r\n                                [-T=&lt;pageTemplate&gt;] [-w=&lt;workDir&gt;]\r\n                                [-c=&lt;String=String&gt;]... [-C=URL]...\r\n                                [-M=&lt;String=String&gt;]... [-e[=&lt;excludes&gt;...]]...\r\n                                [-i[=&lt;includes&gt;...]]... &lt;output&gt;\r\nGenerates HTML site\r\n      &lt;output&gt;               Output directory relative to the base directory\r\n  -b, --base-dir=&lt;baseDir&gt;   Base directory\r\n  -c, --context-entry=&lt;String=String&gt;\r\n                             Context entries.\r\n                             Shadow entries in contexts and mounts.\r\n  -C, --context=URL          Context resource URL relative to the current\r\n                               directory. YAML, JSON, or properties. In\r\n                               properties dots are treated as key path\r\n                               separators. Type is inferred from the content\r\n                               type header, if it is present, or extension.\r\n                               Contexts are composed in the order of\r\n                               definition, later context entries shadowing the\r\n                               former\r\n  -e, --exclude[=&lt;excludes&gt;...]\r\n                             Output directory clean excludes\r\n                             Ant pattern\r\n  -F, --page-template-file=&lt;pageTemplateFile&gt;\r\n                             Page template file relative\r\n                             to the current directory\r\n  -h, --help                 Show this help message and exit.\r\n  -i, --include[=&lt;includes&gt;...]\r\n                             Output directory clean includes\r\n                             Ant pattern\r\n  -l, --[no-]clean           Clean working directory\r\n                             defaults to true\r\n  -m, --domain=&lt;domian&gt;      Sitemap domain\r\n  -M, --context-mount=&lt;String=String&gt;\r\n                             MappingContext resource URL relative to the\r\n                               current directory. YAML, JSON, or properties. In\r\n                               properties dots are treated as key path\r\n                               separators. Type is inferred from the content\r\n                               type header, if it is present, or extension.\r\n                               Mounts shadow context entries.\r\n  -P, --parallelism=&lt;parallelism&gt;\r\n                             If the value greater than one then an executor\r\n                               service is created and injected into the context\r\n                               to allow concurrent execution.\r\n      --progress-console     Output progress to console\r\n      --progress-data        Output progress data\r\n      --progress-json        Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                             Output file for progress monitor\r\n  -r, --errors=&lt;pageErrors&gt;  Expected number of page errors\r\n                             -1 for any (not fail on errors)\r\n                             default is 0\r\n  -t, --timeout=&lt;timeout&gt;    If parallelism is greater than one this option\r\n                               specifies timout in seconds awaiting completion\r\n                               of execution. Default value is 60.\r\n  -T, --page-template=&lt;pageTemplate&gt;\r\n                             Page template URI relative\r\n                             to the current directory\r\n  -V, --version              Print version information and exit.\r\n  -w, --work-dir=&lt;workDir&gt;   Working directory\r\nExit codes:\r\n  Non-negative number   Delegate result\r\n  -1                    Unhandled exception during execution\r\n  -2                    Invalid input\r\n  -3                    Diagnostic failed\r\n  -4                    Execution failed or was cancelled, successful rollback\r\n  -5                    Execution failed or was cancelled, rollback failed\r\n  -6                    Executor service termination timed out"},"help/index.html":{"link-uuid":"ec254d6e-1438-49e3-8fee-ae0b9493c4c6","title":"help","content":"Usage: nsd help [-ahHV] [-l=&lt;level&gt;] [-o=&lt;output&gt;] [COMMAND]\r\nOutputs usage for all registred commands\r\n  -a, --action-model      Output to action model\r\n  -h, --help              Show this help message and exit.\r\n  -H, --html              Output to HTML\r\n  -l, --header-level=&lt;level&gt;\r\n                          Starting level for HTML header tags in HTML output,\r\n                            the default value is 1.\r\n  -o, --output=&lt;output&gt;   Output file\r\n  -V, --version           Print version information and exit.\r\nCommands:\r\n  site  Generates help HTML site"},"help/site/index.html":{"path":"help/site","link-uuid":"b3eb5689-69a0-4967-ad7c-af0c69ec50b2","title":"site","content":"Usage: nsd help site [-hlV] [--progress-console] [--progress-data]\r\n                     [--progress-json] [-b=&lt;baseDir&gt;] [-m=&lt;domian&gt;]\r\n                     [-P=&lt;parallelism&gt;] [--progress-output=&lt;progressOutput&gt;]\r\n                     [-r=&lt;pageErrors&gt;] [--root-action-icon=&lt;rootActionIcon&gt;]\r\n                     [--root-action-location=&lt;rootActionLocation&gt;]\r\n                     [--root-action-text=&lt;rootActionText&gt;] [-t=&lt;timeout&gt;]\r\n                     [-T=&lt;pageTemplate&gt;] [-w=&lt;workDir&gt;] [-c=&lt;String=String&gt;]...\r\n                     [-C=URL]... [-M=&lt;String=String&gt;]... [-e\r\n                     [=&lt;excludes&gt;...]]... [-i[=&lt;includes&gt;...]]... &lt;output&gt;\r\nGenerates help HTML site\r\n      &lt;output&gt;               Output directory\r\n  -b, --base-dir=&lt;baseDir&gt;   Base directory\r\n  -c, --context-entry=&lt;String=String&gt;\r\n                             Context entries.\r\n                             Shadow entries in contexts and mounts.\r\n  -C, --context=URL          Context resource URL relative to the current\r\n                               directory. YAML, JSON, or properties. In\r\n                               properties dots are treated as key path\r\n                               separators. Type is inferred from the content\r\n                               type header, if it is present, or extension.\r\n                               Contexts are composed in the order of\r\n                               definition, later context entries shadowing the\r\n                               former\r\n  -e, --exclude[=&lt;excludes&gt;...]\r\n                             Output directory clean excludes\r\n                             Ant pattern\r\n  -h, --help                 Show this help message and exit.\r\n  -i, --include[=&lt;includes&gt;...]\r\n                             Output directory clean includes\r\n                             Ant pattern\r\n  -l, --[no-]clean           Clean working directory\r\n                             defaults to true\r\n  -m, --domain=&lt;domian&gt;      Sitemap domain\r\n  -M, --context-mount=&lt;String=String&gt;\r\n                             MappingContext resource URL relative to the\r\n                               current directory. YAML, JSON, or properties. In\r\n                               properties dots are treated as key path\r\n                               separators. Type is inferred from the content\r\n                               type header, if it is present, or extension.\r\n                               Mounts shadow context entries.\r\n  -P, --parallelism=&lt;parallelism&gt;\r\n                             If the value greater than one then an executor\r\n                               service is created and injected into the context\r\n                               to allow concurrent execution.\r\n      --progress-console     Output progress to console\r\n      --progress-data        Output progress data\r\n      --progress-json        Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                             Output file for progress monitor\r\n  -r, --errors=&lt;pageErrors&gt;  Expected number of page errors\r\n                             -1 for any (not fail on errors)\r\n                             default is 0\r\n      --root-action-icon=&lt;rootActionIcon&gt;\r\n                             Root action icon\r\n      --root-action-location=&lt;rootActionLocation&gt;\r\n                             Root action location\r\n      --root-action-text=&lt;rootActionText&gt;\r\n                             Root action text\r\n  -t, --timeout=&lt;timeout&gt;    If parallelism is greater than one this option\r\n                               specifies timout in seconds awaiting completion\r\n                               of execution. Default value is 60.\r\n  -T, --page-template=&lt;pageTemplate&gt;\r\n                             Page template URI relative\r\n                             to the current directory\r\n  -V, --version              Print version information and exit.\r\n  -w, --work-dir=&lt;workDir&gt;   Working directory\r\nExit codes:\r\n  Non-negative number   Delegate result\r\n  -1                    Unhandled exception during execution\r\n  -2                    Invalid input\r\n  -3                    Diagnostic failed\r\n  -4                    Execution failed or was cancelled, successful rollback\r\n  -5                    Execution failed or was cancelled, rollback failed\r\n  -6                    Executor service termination timed out"},"app/site/index.html":{"path":"app/site","link-uuid":"388928d0-8175-4a63-af93-9db245d49421","title":"site","content":"Version: org.nasdanika.models.app.cli@2024.12.0 \r\nUsage: nsd app site [-hlV] [--progress-console] [--progress-data]\r\n                    [--progress-json] [-b=&lt;baseDir&gt;] [-m=&lt;domian&gt;]\r\n                    [-P=&lt;parallelism&gt;] [--progress-output=&lt;progressOutput&gt;]\r\n                    [-r=&lt;pageErrors&gt;] [-t=&lt;timeout&gt;] [-T=&lt;pageTemplate&gt;]\r\n                    [-w=&lt;workDir&gt;] [-c=&lt;String=String&gt;]... [-C=URL]...\r\n                    [-M=&lt;String=String&gt;]... [-e[=&lt;excludes&gt;...]]... [-i\r\n                    [=&lt;includes&gt;...]]... &lt;model&gt; &lt;output&gt;\r\nGenerates HTML site\r\n      &lt;model&gt;                Model URI, resolved relative\r\n                             to the current directory\r\n      &lt;output&gt;               Output directory\r\n  -b, --base-dir=&lt;baseDir&gt;   Base directory\r\n  -c, --context-entry=&lt;String=String&gt;\r\n                             Context entries.\r\n                             Shadow entries in contexts and mounts.\r\n  -C, --context=URL          Context resource URL relative to the current\r\n                               directory. YAML, JSON, or properties. In\r\n                               properties dots are treated as key path\r\n                               separators. Type is inferred from the content\r\n                               type header, if it is present, or extension.\r\n                               Contexts are composed in the order of\r\n                               definition, later context entries shadowing the\r\n                               former\r\n  -e, --exclude[=&lt;excludes&gt;...]\r\n                             Output directory clean excludes\r\n                             Ant pattern\r\n  -h, --help                 Show this help message and exit.\r\n  -i, --include[=&lt;includes&gt;...]\r\n                             Output directory clean includes\r\n                             Ant pattern\r\n  -l, --[no-]clean           Clean working directory\r\n                             defaults to true\r\n  -m, --domain=&lt;domian&gt;      Sitemap domain\r\n  -M, --context-mount=&lt;String=String&gt;\r\n                             MappingContext resource URL relative to the\r\n                               current directory. YAML, JSON, or properties. In\r\n                               properties dots are treated as key path\r\n                               separators. Type is inferred from the content\r\n                               type header, if it is present, or extension.\r\n                               Mounts shadow context entries.\r\n  -P, --parallelism=&lt;parallelism&gt;\r\n                             If the value greater than one then an executor\r\n                               service is created and injected into the context\r\n                               to allow concurrent execution.\r\n      --progress-console     Output progress to console\r\n      --progress-data        Output progress data\r\n      --progress-json        Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                             Output file for progress monitor\r\n  -r, --errors=&lt;pageErrors&gt;  Expected number of page errors\r\n                             -1 for any (not fail on errors)\r\n                             default is 0\r\n  -t, --timeout=&lt;timeout&gt;    If parallelism is greater than one this option\r\n                               specifies timout in seconds awaiting completion\r\n                               of execution. Default value is 60.\r\n  -T, --page-template=&lt;pageTemplate&gt;\r\n                             Page template URI relative\r\n                             to the current directory\r\n  -V, --version              Print version information and exit.\r\n  -w, --work-dir=&lt;workDir&gt;   Working directory\r\nExit codes:\r\n  Non-negative number   Delegate result\r\n  -1                    Unhandled exception during execution\r\n  -2                    Invalid input\r\n  -3                    Diagnostic failed\r\n  -4                    Execution failed or was cancelled, successful rollback\r\n  -5                    Execution failed or was cancelled, rollback failed\r\n  -6                    Executor service termination timed out"},"gitlab/contribute/invoke/index.html":{"path":"gitlab/contribute/invoke","link-uuid":"f30d9816-d38e-4263-aee4-b0d83e720d27","title":"invoke","content":"Version: org.nasdanika.cli@2024.12.0 \r\nUsage: nsd gitlab contribute invoke [-fhV] [--progress-console]\r\n                                    [--progress-data] [--progress-json]\r\n                                    [--progress-output=&lt;progressOutput&gt;]\r\n                                    [-p=&lt;String=String&gt;]... [-P=URL]... &lt;uri&gt;\r\n                                    [&lt;bindings&gt;...]\r\nInvokes URI\r\n      &lt;uri&gt;                URI to invoke\r\n      [&lt;bindings&gt;...]      Bindings URIs\r\n  -f, --file               URI parameter is a file path\r\n  -h, --help               Show this help message and exit.\r\n  -p, --property=&lt;String=String&gt;\r\n                           Property\r\n  -P, --properties=URL     Properties resource URL relative to the current\r\n                             directory. YAML, JSON, or properties. Type is\r\n                             inferred from the content type header, if it is\r\n                             present, or extension. Properties are loaded in\r\n                             the order of definition, later properties\r\n                             replacing the former\r\n      --progress-console   Output progress to console\r\n      --progress-data      Output progress data\r\n      --progress-json      Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                           Output file for progress monitor\r\n  -V, --version            Print version information and exit."},"gsh/index.html":{"link-uuid":"731601b9-7ed8-4d72-bec3-a3a204de6dd5","title":"gsh","content":"Version: org.nasdanika.groovy@2024.12.0 \r\nUsage: nsd gsh [-hV] [--progress-console] [--progress-data] [--progress-json]\r\n               [--progress-output=&lt;progressOutput&gt;] [-p=&lt;String=String&gt;]...\r\n               [-P=URL]... [&lt;args&gt;...]\r\nGroovy Shell\r\n      [&lt;args&gt;...]          Argument URIs\r\n  -h, --help               Show this help message and exit.\r\n  -p, --property=&lt;String=String&gt;\r\n                           Property\r\n  -P, --properties=URL     Properties resource URL relative to the current\r\n                             directory. YAML, JSON, or properties. Type is\r\n                             inferred from the content type header, if it is\r\n                             present, or extension. Properties are loaded in\r\n                             the order of definition, later properties\r\n                             replacing the former\r\n      --progress-console   Output progress to console\r\n      --progress-data      Output progress data\r\n      --progress-json      Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                           Output file for progress monitor\r\n  -V, --version            Print version information and exit."},"gitlab/contribute/retrospect/invoke/index.html":{"path":"gitlab/contribute/retrospect/invoke","link-uuid":"eefe5d8b-9c17-408d-aa92-16a70a920860","title":"invoke","content":"Version: org.nasdanika.cli@2024.12.0 \r\nUsage: nsd gitlab contribute retrospect invoke [-fhV] [--progress-console]\r\n       [--progress-data] [--progress-json] [--progress-output=&lt;progressOutput&gt;]\r\n       [-p=&lt;String=String&gt;]... [-P=URL]... &lt;uri&gt; [&lt;bindings&gt;...]\r\nInvokes URI\r\n      &lt;uri&gt;                URI to invoke\r\n      [&lt;bindings&gt;...]      Bindings URIs\r\n  -f, --file               URI parameter is a file path\r\n  -h, --help               Show this help message and exit.\r\n  -p, --property=&lt;String=String&gt;\r\n                           Property\r\n  -P, --properties=URL     Properties resource URL relative to the current\r\n                             directory. YAML, JSON, or properties. Type is\r\n                             inferred from the content type header, if it is\r\n                             present, or extension. Properties are loaded in\r\n                             the order of definition, later properties\r\n                             replacing the former\r\n      --progress-console   Output progress to console\r\n      --progress-data      Output progress data\r\n      --progress-json      Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                           Output file for progress monitor\r\n  -V, --version            Print version information and exit."},"list-rules/index.html":{"link-uuid":"6aaf190b-6d65-4ae0-8ffc-947e5cbb8225","title":"list-rules","content":"Version: org.nasdanika.launcher.demo \r\nUsage: nsd list-rules [-hV] [-o=&lt;output&gt;] [--exclude-rule\r\n                      [=&lt;ruleExcludes&gt;...]]... [--exclude-rule-set\r\n                      [=&lt;ruleSetExcludes&gt;...]]... [--include-rule\r\n                      [=&lt;ruleIncludes&gt;...]]... [--include-rule-set\r\n                      [=&lt;ruleSetIncludes&gt;...]]...\r\nLists available rules\r\n      --exclude-rule[=&lt;ruleExcludes&gt;...]\r\n                          ID's of rules to exclude\r\n      --exclude-rule-set[=&lt;ruleSetExcludes&gt;...]\r\n                          ID's of rule sets to exclude\r\n  -h, --help              Show this help message and exit.\r\n      --include-rule[=&lt;ruleIncludes&gt;...]\r\n                          ID's of rules to include\r\n      --include-rule-set[=&lt;ruleSetIncludes&gt;...]\r\n                          ID's of rule sets to include\r\n  -o, --output=&lt;output&gt;   Output file\r\n  -V, --version           Print version information and exit."},"inspect-yaml/index.html":{"link-uuid":"5cb28603-de97-468e-b144-53626e616ff2","title":"inspect-yaml","content":"Version: org.nasdanika.launcher.demo \r\nUsage: nsd inspect-yaml [-hV] [--parallel] [--progress-console]\r\n                        [--progress-data] [--progress-json]\r\n                        [--stop-on-first-fail] [--limit=&lt;limit&gt;] [-o=&lt;output&gt;]\r\n                        [--progress-output=&lt;progressOutput&gt;]\r\n                        [-c=&lt;String=String&gt;]... [-C=URL]...\r\n                        [--content-type-resource-factory=&lt;String=Class&gt;]...\r\n                        [--extension-resource-factory=&lt;String=Class&gt;]...\r\n                        [-f=&lt;failOnSeverities&gt;]... [-M=&lt;String=String&gt;]...\r\n                        [--protocol-resource-factory=&lt;String=Class&gt;]... [-e\r\n                        [=&lt;resourceExcludes&gt;...]]... [--exclude-rule\r\n                        [=&lt;ruleExcludes&gt;...]]... [--exclude-rule-set\r\n                        [=&lt;ruleSetExcludes&gt;...]]... [--exclude-type\r\n                        [=&lt;typeExcludes&gt;...]]... [-i\r\n                        [=&lt;resourceIncludes&gt;...]]... [--include-rule\r\n                        [=&lt;ruleIncludes&gt;...]]... [--include-rule-set\r\n                        [=&lt;ruleSetIncludes&gt;...]]... [--include-type\r\n                        [=&lt;typeIncludes&gt;...]]... &lt;inputs&gt;...\r\nDemo of YAML inspection\r\n      &lt;inputs&gt;...            Files and directories\r\n                             to inspect\r\n  -c, --context-entry=&lt;String=String&gt;\r\n                             Context entries.\r\n                             Shadow entries in contexts and mounts.\r\n  -C, --context=URL          Context resource URL relative to the current\r\n                               directory. YAML, JSON, or properties. In\r\n                               properties dots are treated as key path\r\n                               separators. Type is inferred from the content\r\n                               type header, if it is present, or extension.\r\n                               Contexts are composed in the order of\r\n                               definition, later context entries shadowing the\r\n                               former\r\n      --content-type-resource-factory=&lt;String=Class&gt;\r\n                             Maps content type to resource factory class\r\n  -e, --exclude-resource[=&lt;resourceExcludes&gt;...]\r\n                             Resources to exclude from inspection\r\n                             Ant pattern\r\n      --exclude-rule[=&lt;ruleExcludes&gt;...]\r\n                             ID's of rules to exclude\r\n      --exclude-rule-set[=&lt;ruleSetExcludes&gt;...]\r\n                             ID's of rule sets to exclude\r\n      --exclude-type[=&lt;typeExcludes&gt;...]\r\n                             Target types to exclude\r\n      --extension-resource-factory=&lt;String=Class&gt;\r\n                             Maps extension to resource factory class\r\n  -f, --fail-on=&lt;failOnSeverities&gt;\r\n                             Names of severities to fail on\r\n  -h, --help                 Show this help message and exit.\r\n  -i, --include-resource[=&lt;resourceIncludes&gt;...]\r\n                             Resources to include in inspection\r\n                             Ant pattern\r\n      --include-rule[=&lt;ruleIncludes&gt;...]\r\n                             ID's of rules to include\r\n      --include-rule-set[=&lt;ruleSetIncludes&gt;...]\r\n                             ID's of rule sets to include\r\n      --include-type[=&lt;typeIncludes&gt;...]\r\n                             Target types to include\r\n      --limit=&lt;limit&gt;        Max number of results to report\r\n  -M, --context-mount=&lt;String=String&gt;\r\n                             MappingContext resource URL relative to the\r\n                               current directory. YAML, JSON, or properties. In\r\n                               properties dots are treated as key path\r\n                               separators. Type is inferred from the content\r\n                               type header, if it is present, or extension.\r\n                               Mounts shadow context entries.\r\n  -o, --output=&lt;output&gt;      Output file\r\n      --parallel             Parallel inspection\r\n      --progress-console     Output progress to console\r\n      --progress-data        Output progress data\r\n      --progress-json        Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                             Output file for progress monitor\r\n      --protocol-resource-factory=&lt;String=Class&gt;\r\n                             Maps protocol to resource factory class\r\n      --stop-on-first-fail   Stop on first failure\r\n  -V, --version              Print version information and exit."},"invoke/index.html":{"link-uuid":"90394c7c-eba0-4a1c-9f8c-a3d530270979","title":"invoke","content":"Version: org.nasdanika.cli@2024.12.0 \r\nUsage: nsd invoke [-fhV] [--progress-console] [--progress-data]\r\n                  [--progress-json] [--progress-output=&lt;progressOutput&gt;]\r\n                  [-p=&lt;String=String&gt;]... [-P=URL]... &lt;uri&gt; [&lt;bindings&gt;...]\r\nInvokes URI\r\n      &lt;uri&gt;                URI to invoke\r\n      [&lt;bindings&gt;...]      Bindings URIs\r\n  -f, --file               URI parameter is a file path\r\n  -h, --help               Show this help message and exit.\r\n  -p, --property=&lt;String=String&gt;\r\n                           Property\r\n  -P, --properties=URL     Properties resource URL relative to the current\r\n                             directory. YAML, JSON, or properties. Type is\r\n                             inferred from the content type header, if it is\r\n                             present, or extension. Properties are loaded in\r\n                             the order of definition, later properties\r\n                             replacing the former\r\n      --progress-console   Output progress to console\r\n      --progress-data      Output progress data\r\n      --progress-json      Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                           Output file for progress monitor\r\n  -V, --version            Print version information and exit."},"model/html-app/index.html":{"path":"model/html-app","link-uuid":"f891c1c8-84b3-47a4-ab4c-cc1ed9a8469c","title":"html-app","content":"Version: org.nasdanika.models.app.cli@2024.12.0 \r\nUsage: nsd model html-app [-fhRV] [-P=&lt;insertionIndex&gt;] [-r=&lt;rootLabel&gt;]\r\n                          [-c=&lt;String=String&gt;]... [-C=URL]...\r\n                          [--content-type-resource-factory=&lt;String=Class&gt;]...\r\n                          [--extension-resource-factory=&lt;String=Class&gt;]...\r\n                          [-M=&lt;String=String&gt;]...\r\n                          [--protocol-resource-factory=&lt;String=Class&gt;]...\r\n                          [COMMAND]\r\nGenerates html application model from a drawio document\r\n  -c, --context-entry=&lt;String=String&gt;\r\n                      Context entries.\r\n                      Shadow entries in contexts and mounts.\r\n  -C, --context=URL   Context resource URL relative to the current directory.\r\n                        YAML, JSON, or properties. In properties dots are\r\n                        treated as key path separators. Type is inferred from\r\n                        the content type header, if it is present, or\r\n                        extension. Contexts are composed in the order of\r\n                        definition, later context entries shadowing the former\r\n      --content-type-resource-factory=&lt;String=Class&gt;\r\n                      Maps content type to resource factory class\r\n      --extension-resource-factory=&lt;String=Class&gt;\r\n                      Maps extension to resource factory class\r\n  -f, --file          Root action option is a file path\r\n  -h, --help          Show this help message and exit.\r\n  -M, --context-mount=&lt;String=String&gt;\r\n                      MappingContext resource URL relative to the current\r\n                        directory. YAML, JSON, or properties. In properties\r\n                        dots are treated as key path separators. Type is\r\n                        inferred from the content type header, if it is\r\n                        present, or extension. Mounts shadow context entries.\r\n  -P, --position=&lt;insertionIndex&gt;\r\n                      Insertion position\r\n                      Defaults to 0\r\n      --protocol-resource-factory=&lt;String=Class&gt;\r\n                      Maps protocol to resource factory class\r\n  -r, --root-label=&lt;rootLabel&gt;\r\n                      Root label URL or file path, resolved relative\r\n                      to the current directory\r\n  -R, --add-to-root   Add labels to the root\r\n                      even if the principal is present\r\n  -V, --version       Print version information and exit.\r\nCommands:\r\n  save  Saves model to a file\r\n  site  Generates HTML site"},"drawio/html-app/save/index.html":{"path":"drawio/html-app/save","link-uuid":"62b512a8-cea5-4f26-abb2-de18eca454dd","title":"save","content":"Version: org.nasdanika.cli@2024.12.0 \r\nUsage: nsd drawio html-app save [-hV] [--progress-console] [--progress-data]\r\n                                [--progress-json]\r\n                                [--progress-output=&lt;progressOutput&gt;]\r\n                                [--content-type-resource-factory=&lt;String=Class&gt;]\r\n                                ...\r\n                                [--extension-resource-factory=&lt;String=Class&gt;]...\r\n\r\n                                [--protocol-resource-factory=&lt;String=Class&gt;]...\r\n                                &lt;output&gt;\r\nSaves model to a file\r\n      &lt;output&gt;             Output file\r\n      --content-type-resource-factory=&lt;String=Class&gt;\r\n                           Maps content type to resource factory class\r\n      --extension-resource-factory=&lt;String=Class&gt;\r\n                           Maps extension to resource factory class\r\n  -h, --help               Show this help message and exit.\r\n      --progress-console   Output progress to console\r\n      --progress-data      Output progress data\r\n      --progress-json      Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                           Output file for progress monitor\r\n      --protocol-resource-factory=&lt;String=Class&gt;\r\n                           Maps protocol to resource factory class\r\n  -V, --version            Print version information and exit."},"java/index.html":{"link-uuid":"1e570a1b-0f49-4876-97bc-365cb1c8d2bf","title":"java","content":"Version: org.nasdanika.models.java.cli@2024.12.0 \r\nUsage: nsd java [-hV] [COMMAND]\r\nCommands related to Java\r\n  -h, --help      Show this help message and exit.\r\n  -V, --version   Print version information and exit.\r\nCommands:\r\n  junit  Generates JUnit tests"},"rules/action-model/index.html":{"path":"rules/action-model","link-uuid":"943aa782-3577-40e3-9c34-4e2cb0817d44","title":"action-model","content":"Usage: nsd rules action-model [-fhRV] [--progress-console] [--progress-data]\r\n                              [--progress-json]\r\n                              [--progress-output=&lt;progressOutput&gt;]\r\n                              [-c=&lt;String=String&gt;]... [-C=URL]...\r\n                              [-M=&lt;String=String&gt;]... &lt;model&gt; &lt;output&gt;\r\nGenerates rule set documentation action model\r\n      &lt;model&gt;              Model URI or file path, resolved relative\r\n                           to the current directory\r\n                           or looked up in registered rule sets\r\n                           if -R option is provided\r\n      &lt;output&gt;             Output file\r\n  -c, --context-entry=&lt;String=String&gt;\r\n                           Context entries.\r\n                           Shadow entries in contexts and mounts.\r\n  -C, --context=URL        Context resource URL relative to the current\r\n                             directory. YAML, JSON, or properties. In\r\n                             properties dots are treated as key path\r\n                             separators. Type is inferred from the content type\r\n                             header, if it is present, or extension. Contexts\r\n                             are composed in the order of definition, later\r\n                             context entries shadowing the former\r\n  -f, --file               Mdel parameter is a file path\r\n  -h, --help               Show this help message and exit.\r\n  -M, --context-mount=&lt;String=String&gt;\r\n                           MappingContext resource URL relative to the current\r\n                             directory. YAML, JSON, or properties. In\r\n                             properties dots are treated as key path\r\n                             separators. Type is inferred from the content type\r\n                             header, if it is present, or extension. Mounts\r\n                             shadow context entries.\r\n      --progress-console   Output progress to console\r\n      --progress-data      Output progress data\r\n      --progress-json      Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                           Output file for progress monitor\r\n  -R, --registered         Use registered rule set\r\n                           with provided URI\r\n  -V, --version            Print version information and exit."},"gitlab/contribute/gsh/index.html":{"path":"gitlab/contribute/gsh","link-uuid":"fda21868-e27a-45e6-befc-f9aeefaa8892","title":"gsh","content":"Version: org.nasdanika.groovy@2024.12.0 \r\nUsage: nsd gitlab contribute gsh [-hV] [--progress-console] [--progress-data]\r\n                                 [--progress-json]\r\n                                 [--progress-output=&lt;progressOutput&gt;]\r\n                                 [-p=&lt;String=String&gt;]... [-P=URL]... [&lt;args&gt;...]\r\nGroovy Shell\r\n      [&lt;args&gt;...]          Argument URIs\r\n  -h, --help               Show this help message and exit.\r\n  -p, --property=&lt;String=String&gt;\r\n                           Property\r\n  -P, --properties=URL     Properties resource URL relative to the current\r\n                             directory. YAML, JSON, or properties. Type is\r\n                             inferred from the content type header, if it is\r\n                             present, or extension. Properties are loaded in\r\n                             the order of definition, later properties\r\n                             replacing the former\r\n      --progress-console   Output progress to console\r\n      --progress-data      Output progress data\r\n      --progress-json      Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                           Output file for progress monitor\r\n  -V, --version            Print version information and exit."},"gitlab/gsh/index.html":{"path":"gitlab/gsh","link-uuid":"d717a84f-6463-46ba-a11d-2ba368439573","title":"gsh","content":"Version: org.nasdanika.groovy@2024.12.0 \r\nUsage: nsd gitlab gsh [-hV] [--progress-console] [--progress-data]\r\n                      [--progress-json] [--progress-output=&lt;progressOutput&gt;]\r\n                      [-p=&lt;String=String&gt;]... [-P=URL]... [&lt;args&gt;...]\r\nGroovy Shell\r\n      [&lt;args&gt;...]          Argument URIs\r\n  -h, --help               Show this help message and exit.\r\n  -p, --property=&lt;String=String&gt;\r\n                           Property\r\n  -P, --properties=URL     Properties resource URL relative to the current\r\n                             directory. YAML, JSON, or properties. Type is\r\n                             inferred from the content type header, if it is\r\n                             present, or extension. Properties are loaded in\r\n                             the order of definition, later properties\r\n                             replacing the former\r\n      --progress-console   Output progress to console\r\n      --progress-data      Output progress data\r\n      --progress-json      Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                           Output file for progress monitor\r\n  -V, --version            Print version information and exit."},"shell/index.html":{"link-uuid":"d23eae97-ee1f-465e-80a3-58bb0610979a","title":"shell","content":"Usage: nsd shell [-hV]\r\nStarts an interactive shell\r\nor executes commands from input\r\nfiles or URL's\r\n  -h, --help      Show this help message and exit.\r\n  -V, --version   Print version information and exit."},"gitlab/contribute/junit/index.html":{"path":"gitlab/contribute/junit","link-uuid":"6fb2d3b2-bbf1-4959-a6ad-c87566f323ea","title":"junit","content":"Version: org.nasdanika.models.java.cli@2024.12.0 \r\nUsage: nsd gitlab contribute junit [-fhVw] [--[no-]ai] [--[no-]\r\n                                   comment-response] [--disabled]\r\n                                   [--progress-console] [--progress-data]\r\n                                   [--progress-json]\r\n                                   [--api-endpoint=&lt;apiEndpoint&gt;]\r\n                                   [--class-suffix=&lt;classSuffix&gt;] [-k=&lt;apiKey&gt;]\r\n                                   [-l=&lt;limit&gt;] [-m=&lt;deploymentOrModelName&gt;]\r\n                                   [--package-suffix=&lt;packageSuffix&gt;]\r\n                                   [--progress-output=&lt;progressOutput&gt;]\r\n                                   [-r=&lt;prompt&gt;] [-s=&lt;sources&gt;]\r\n                                   [-t=&lt;coverageType&gt;]\r\n                                   [-v=&lt;apiKeyEnvironmentVariable&gt;] [-e\r\n                                   [=&lt;excludes&gt;...]]... [-i[=&lt;includes&gt;...]]...\r\n                                   &lt;projectURI&gt; &lt;coverageThreshold&gt; &lt;output&gt;\r\n                                   [COMMAND]\r\nGenerates JUnit tests\r\n      &lt;projectURI&gt;          Project URI\r\n      &lt;coverageThreshold&gt;   Coverage threshold\r\n      &lt;output&gt;              Output URI\r\n                            relative to the project URI\r\n      --[no-]ai             Use AI, defaults to true\r\n      --api-endpoint=&lt;apiEndpoint&gt;\r\n                            OpenAPI endpoint, defaults to\r\n                            https://api.openai.com/v1/chat/completions\r\n      --class-suffix=&lt;classSuffix&gt;\r\n                            Test class suffix\r\n                            defaults to Tests\r\n      --[no-]comment-response\r\n                            Comment AI responses\r\n                            defaults to true\r\n      --disabled            Generate disabled tests\r\n  -e, --exclude[=&lt;excludes&gt;...]\r\n                            Source excludes\r\n                            Ant pattern\r\n  -f                        Project URI is a file path\r\n  -h, --help                Show this help message and exit.\r\n  -i, --include[=&lt;includes&gt;...]\r\n                            Source includes\r\n                            Ant pattern\r\n  -k, --api-key=&lt;apiKey&gt;    OpenAPI key\r\n  -l, --limit=&lt;limit&gt;       Maximum number of test classes\r\n                            to generate\r\n  -m, --model=&lt;deploymentOrModelName&gt;\r\n                            OpenAPI deployment or model\r\n                            defaults to gpt-4\r\n      --package-suffix=&lt;packageSuffix&gt;\r\n                            Test package suffix\r\n                            defaults to .tests\r\n      --progress-console    Output progress to console\r\n      --progress-data       Output progress data\r\n      --progress-json       Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                            Output file for progress monitor\r\n  -r, --prompt=&lt;prompt&gt;     Propmt\r\n                            defaults to 'Generate a JUnit 5 test method\r\n                              leveraging Mockito for the following Java method'\r\n  -s, --sources=&lt;sources&gt;   Sources URI path relative\r\n                            to the project URIy,\r\n                            defaults to src/main/java\r\n  -t, --coverage-type=&lt;coverageType&gt;\r\n                            Coverage type\r\n                            Valid values: complexity, instruction, branch, line\r\n                            defaults to line\r\n  -v, --api-key-variable=&lt;apiKeyEnvironmentVariable&gt;\r\n                            OpenAPI key environment variable\r\n                            defaults to OPENAI_API_KEY\r\n  -V, --version             Print version information and exit.\r\n  -w, --overwrite           Overwrite existing tests\r\nCommands:\r\n  jacoco  Loads coverage from jacoco.exec and classes directory"},"model/ecore-html-app/save/index.html":{"path":"model/ecore-html-app/save","link-uuid":"b7c974c1-9de0-46f3-ab11-bb450790e36e","title":"save","content":"Version: org.nasdanika.cli@2024.12.0 \r\nUsage: nsd model ecore-html-app save [-hV] [--progress-console]\r\n                                     [--progress-data] [--progress-json]\r\n                                     [--progress-output=&lt;progressOutput&gt;]\r\n                                     [--content-type-resource-factory=&lt;String=Cl\r\n                                     ass&gt;]...\r\n                                     [--extension-resource-factory=&lt;String=Class\r\n                                     &gt;]...\r\n                                     [--protocol-resource-factory=&lt;String=Class&gt;\r\n                                     ]... &lt;output&gt;\r\nSaves model to a file\r\n      &lt;output&gt;             Output file\r\n      --content-type-resource-factory=&lt;String=Class&gt;\r\n                           Maps content type to resource factory class\r\n      --extension-resource-factory=&lt;String=Class&gt;\r\n                           Maps extension to resource factory class\r\n  -h, --help               Show this help message and exit.\r\n      --progress-console   Output progress to console\r\n      --progress-data      Output progress data\r\n      --progress-json      Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                           Output file for progress monitor\r\n      --protocol-resource-factory=&lt;String=Class&gt;\r\n                           Maps protocol to resource factory class\r\n  -V, --version            Print version information and exit."},"java/junit/index.html":{"path":"java/junit","link-uuid":"1bb4b6a1-5931-4328-bd5c-1f36cc6946ba","title":"junit","content":"Version: org.nasdanika.models.java.cli@2024.12.0 \r\nUsage: nsd java junit [-fhVw] [--[no-]ai] [--[no-]comment-response]\r\n                      [--disabled] [--progress-console] [--progress-data]\r\n                      [--progress-json] [--api-endpoint=&lt;apiEndpoint&gt;]\r\n                      [--class-suffix=&lt;classSuffix&gt;] [-k=&lt;apiKey&gt;] [-l=&lt;limit&gt;]\r\n                      [-m=&lt;deploymentOrModelName&gt;]\r\n                      [--package-suffix=&lt;packageSuffix&gt;]\r\n                      [--progress-output=&lt;progressOutput&gt;] [-r=&lt;prompt&gt;]\r\n                      [-s=&lt;sources&gt;] [-t=&lt;coverageType&gt;]\r\n                      [-v=&lt;apiKeyEnvironmentVariable&gt;] [-e[=&lt;excludes&gt;...]]...\r\n                      [-i[=&lt;includes&gt;...]]... &lt;projectURI&gt; &lt;coverageThreshold&gt;\r\n                      &lt;output&gt; [COMMAND]\r\nGenerates JUnit tests\r\n      &lt;projectURI&gt;          Project URI\r\n      &lt;coverageThreshold&gt;   Coverage threshold\r\n      &lt;output&gt;              Output URI\r\n                            relative to the project URI\r\n      --[no-]ai             Use AI, defaults to true\r\n      --api-endpoint=&lt;apiEndpoint&gt;\r\n                            OpenAPI endpoint, defaults to\r\n                            https://api.openai.com/v1/chat/completions\r\n      --class-suffix=&lt;classSuffix&gt;\r\n                            Test class suffix\r\n                            defaults to Tests\r\n      --[no-]comment-response\r\n                            Comment AI responses\r\n                            defaults to true\r\n      --disabled            Generate disabled tests\r\n  -e, --exclude[=&lt;excludes&gt;...]\r\n                            Source excludes\r\n                            Ant pattern\r\n  -f                        Project URI is a file path\r\n  -h, --help                Show this help message and exit.\r\n  -i, --include[=&lt;includes&gt;...]\r\n                            Source includes\r\n                            Ant pattern\r\n  -k, --api-key=&lt;apiKey&gt;    OpenAPI key\r\n  -l, --limit=&lt;limit&gt;       Maximum number of test classes\r\n                            to generate\r\n  -m, --model=&lt;deploymentOrModelName&gt;\r\n                            OpenAPI deployment or model\r\n                            defaults to gpt-4\r\n      --package-suffix=&lt;packageSuffix&gt;\r\n                            Test package suffix\r\n                            defaults to .tests\r\n      --progress-console    Output progress to console\r\n      --progress-data       Output progress data\r\n      --progress-json       Output progress in JSON\r\n      --progress-output=&lt;progressOutput&gt;\r\n                            Output file for progress monitor\r\n  -r, --prompt=&lt;prompt&gt;     Propmt\r\n                            defaults to 'Generate a JUnit 5 test method\r\n                              leveraging Mockito for the following Java method'\r\n  -s, --sources=&lt;sources&gt;   Sources URI path relative\r\n                            to the project URIy,\r\n                            defaults to src/main/java\r\n  -t, --coverage-type=&lt;coverageType&gt;\r\n                            Coverage type\r\n                            Valid values: complexity, instruction, branch, line\r\n                            defaults to line\r\n  -v, --api-key-variable=&lt;apiKeyEnvironmentVariable&gt;\r\n                            OpenAPI key environment variable\r\n                            defaults to OPENAI_API_KEY\r\n  -V, --version             Print version information and exit.\r\n  -w, --overwrite           Overwrite existing tests\r\nCommands:\r\n  jacoco  Loads coverage from jacoco.exec and classes directory"},"module-graph/index.html":{"link-uuid":"421a7895-6b08-4210-9375-ecdb3c9f894e","title":"module-graph","content":"Version: org.nasdanika.launcher.demo \r\nUsage: nsd module-graph [-h=&lt;height&gt;] [-t=&lt;template&gt;] [-w=&lt;width&gt;]\r\n                        [-e=&lt;excludeModules&gt;]... [-i=&lt;includeModules&gt;]...\r\n                        &lt;output&gt;\r\nGenerates module dependency graph\r\n      &lt;output&gt;            Output file\r\n  -e, --exclude-modules=&lt;excludeModules&gt;\r\n                          Modules to exclude\r\n                          Supports .* and .** patterns\r\n  -h, --height=&lt;height&gt;   Layout height, defaults to 1500\r\n  -i, --include-modules=&lt;includeModules&gt;\r\n                          Modules to include\r\n                          Supports .* and .** patterns\r\n  -t, --template=&lt;template&gt;\r\n                          HTML page template\r\n  -w, --width=&lt;width&gt;     Layout width, defaults to 2000"},"model/index.html":{"link-uuid":"03c47c9c-8242-4908-96f4-f407c2511b46","title":"model","content":"Version: org.nasdanika.cli@2024.12.0 \r\nUsage: nsd model [-fhV] [--content-type-resource-factory=&lt;String=Class&gt;]...\r\n                 [--extension-resource-factory=&lt;String=Class&gt;]...\r\n                 [--protocol-resource-factory=&lt;String=Class&gt;]... &lt;uri&gt; [COMMAND]\r\nLoads EObject from a URI or file\r\n      &lt;uri&gt;       EObject URI or file path, resolved relative\r\n                  to the current directory\r\n      --content-type-resource-factory=&lt;String=Class&gt;\r\n                  Maps content type to resource factory class\r\n      --extension-resource-factory=&lt;String=Class&gt;\r\n                  Maps extension to resource factory class\r\n  -f, --file      URI parameter is a file path\r\n  -h, --help      Show this help message and exit.\r\n      --protocol-resource-factory=&lt;String=Class&gt;\r\n                  Maps protocol to resource factory class\r\n  -V, --version   Print version information and exit.\r\nCommands:\r\n  ecore-html-app  Generates Ecore model documentation html app model\r\n  html-app        Generates html application model from a drawio document\r\n  save            Saves model to a file"}}